import React from 'react';
import './main.scss';

const Main = props => {
    return (
        <div className='main-container'>
            {props.countryData.map(cur => (cur.name))}
        </div>
    )
};

const mapStateToProps = state  => {
    return {
        countryData: state.countryData.countryData
    }
}
export default Main;
